Rules.InvariantScript:
Set(
    gblResetComponents,
    true
);
Set(
    gblResetComponents,
    false
)

If(
    IsEmpty(colDropdownValue),
    ClearCollect(
        colDropdownValue,
        AddColumns(
            SearchandSelectComponent.Items,
            "IsSelectedValue",
            false
        )
    )
);

Set(
    gblComponentGalVisibility,
    true
);
If(
    IsEmpty(colDropdownValue),
    ClearCollect(
        colDropdownValue,
        AddColumns(
            SearchandSelectComponent.Items,
            "IsSelectedValue",
            false
        )
    )
);
Set(
    gblComboBoxText,
    Blank()
);
Select(rctResetSS)

If(
    !gblComponentGalVisibility,
    //DropDown Icon Functionality
    Set(
        gblComponentGalVisibility,
        true
    );
    SetFocus(txtTextInputSS);
    Select(txtTextInputSS);
    ,
    //Close Icon Functionality
    If(
        IsEmpty(SearchandSelectComponent.SelectedItems),
        If(
            IsBlank(txtTextInputSS.Text),
            Reset(SearchandSelectComponent),
            Reset(txtTextInputSS);
            SetFocus(txtTextInputSS)
        ),
        ClearCollect(
            colDropdownValue,
            AddColumns(
                SearchandSelectComponent.Items,
                "IsSelectedValue",
                false
            )
        );
        Reset(txtTextInputSS);
        SetFocus(txtTextInputSS)
    )
)

Parent.Width - (SearchandSelectComponent.StylingProperty.Checkbox.RightMargin * SearchandSelectComponent.ScaleFactor) - If(
    CountRows(
        Search(
            colDropdownValue,
            txtTextInputSS.Text,
            "Value"
        )
    ) > 5,
    SearchandSelectComponent.StylingProperty.TextInput.ScrollWith
)

Not(
    ThisItem.Value = Last(
        Search(
            colDropdownValue,
            txtTextInputSS.Text,
            "Value"
        )
    ).Value
)

Set(
    gblComponentGalVisibility,
    false
);
Set(
    gblTabIndex,
    0
);
If(
    Self.DisplayMode = "View",
    Set(
        gblComboBoxText,
        If(
            CountRows(Self.Default) <= 1,
            First(Self.Default).Value,
            CountRows(Self.Default) & " values selected"
        )
    ),
    With(
        {
            SelectedItems: Filter(
                colDropdownValue,
                IsSelectedValue = true
            )
        },
        Set(
            gblComboBoxText,
            Switch(
                CountRows(SelectedItems),
                0,
                "",
                1,
                First(SelectedItems).Value,
                CountRows(SelectedItems) & " values selected"
            )
        )
    )
);
If(
    Self.Clear,
    ClearCollect(
        colDropdownValue,
        AddColumns(
            SearchandSelectComponent.Items,
            "IsSelectedValue",
            false
        )
    )
)
